export function inputQuestion(values) {
    return {
        type: "INPUT_QUESTION",
        payload: values
    };
}

export function editQuestion(editedQuestion) {
    return {
        type: "EDIT_QUESTION",
        payload: editedQuestion
    };
}

export function deleteQuestion(qid) {
    return {
        type: "DELETE_QUESTION",
        payload: qid
    };
}
